import './AllCss.css';
import Teacher from './SliderPic/Teacher.jpg'
function Contact() {
    return (
        <div>
            <div className="container my-5 bg-danger-subtle BeacomeTeacher">
                <div className="row">
                    <div className="col-md-6">
                        <img src={Teacher} className="img-fluid w-100 " />
                    </div>
                   
                </div>
            </div>
        </div>

    );
}
export default Contact;
